import logo from './logo.svg';
import './App.css';
import Loginpage from './Components/Loginpage';
import { Route, Router } from '@mui/icons-material';

function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path='/' element={<Loginpage/>} ></Route>
      </Router>
    </div>
  );
}

export default App;
